const Category = () => {
  const router = useRouter();
  const { category } = router.query;
  const products = useContext(Context).data;
  console.log(products);

  return (
    <React.Fragment>
      <Layout>{category}</Layout>
    </React.Fragment>
  );
};

export default Category;
